import React from 'react';

import { Container, Title, ExpandIcon } from './styles';

const ChannelButton: React.FC = () => {
    return (
        <Container>
            <Title>Servidor do Rodrigo</Title>

            <ExpandIcon />
        </Container>
    );
};

export default ChannelButton;
